        private static byte[] aesIVBase = new byte[16] { 239, 68, 204, 163, 219, 235, 157, 26, 55, 162, 251, 0, 207, 131, 254, 254 };

        private static string subfolder = "Profiles";
        private static string extension = ".GDSBX";
        private static string baseFolder = Path.Combine(Application.StartupPath, subfolder);

        public static bool UpdateProfile(Profile profile)
        {
            profile.fullFileName = Path.Combine(baseFolder, new FileInfo(profile.fullFileName).Name);
            string profileBKP = string.Empty;
            if (File.Exists(profile.fullFileName))
                profileBKP = File.ReadAllText(profile.fullFileName);
            try
            {
                while (File.Exists(profile.fullFileName))
                    File.Delete(profile.fullFileName);
                CreateProfile(profile);

                return true;
            }
            catch (Exception ex)
            {
                if (profileBKP != string.Empty)
                {
                    MessageBox.Show("Houve um erro ao tentar atualizar o perfil, será realizado um rollback e sua atualizacao não será acatada\n\nErro: " + ex.Message);
                    if (File.Exists(profile.fullFileName))
                        File.Delete(profile.fullFileName);


                    using (var stream = File.CreateText(profile.fullFileName))
                        stream.Write(profileBKP);
                }
                return false;
            }
        }
        public static List<EncryptedProfile> GetAllProfiles()
        {
            var ls = new List<EncryptedProfile>();
            if (!Directory.Exists(baseFolder))
                return ls;

            var names = Directory.GetFiles(baseFolder).Where(x => x.EndsWith(extension)).ToList();

            foreach (var name in names)
                ls.Add(GetEncryptedProfile(name));

            return ls.OrderBy(x => x.name).ToList();
        }
        public static void CreateProfile(Profile profile)//string nome, string senha, bool Auth, DateTime dt, DateTime dtnascimento, string imgBase64, List<SecretBox> lsBoxes, Color pnBackColor, string fullFileName = null)
        {
            if (!Directory.Exists(baseFolder))
                Directory.CreateDirectory(baseFolder);


            var tempfile = Path.GetTempFileName();
            var file = File.Create(Path.Combine(baseFolder, new FileInfo(Path.GetFileNameWithoutExtension(tempfile)).Name.Replace("tmp", "prf") + DateTime.Now.Second + DateTime.Now.Millisecond) + extension);
            file.Close();
            string fl = file.Name;
            if (!string.IsNullOrEmpty(profile.fullFileName))
            {
                File.Move(file.Name, profile.fullFileName);
                fl = profile.fullFileName;
            }
            File.Delete(tempfile);

            profile.fullFileName = fl;


            string dadosPrincipais = JsonConvert.SerializeObject(profile);

            Aes aes = Aes.Create();
            var dadosEncryp = EncryptStringToBytes_Aes(dadosPrincipais, aes.Key, aes.IV);

            var jsonAES = JsonConvert.SerializeObject(new EncryptedJsonAES()
            {
                Montain = dadosEncryp,
                secbyte = aes.IV,
                bytekyte = aes.Key
            });

            var encryptedAesJson = EncryptStringToBytes_Aes(jsonAES, GetPasswordStringIntoByte(profile.senha), aesIVBase);
            EncryptedProfile encryptedProfile = new EncryptedProfile()
            {
                baseImg64 = profile.imageBase64,
                name = profile.nome,
                profileEncrypted = encryptedAesJson
            };

            var jsonFinal = JsonConvert.SerializeObject(encryptedProfile);

            File.WriteAllText(fl, jsonFinal);

        }
        private static byte[] GetPasswordStringIntoByte(string senha)
        {
            byte[] newKey = new byte[32];
            var bts = Encoding.ASCII.GetBytes(senha);
            int countPassLengh = 0;
            for (int i = 0; i < newKey.Length; i++)
            {
                if (countPassLengh == bts.Length)
                    countPassLengh = 0;
                newKey[i] = bts[countPassLengh];
                countPassLengh++;
            }
            return newKey;
        }

        public static EncryptedProfile GetEncryptedProfile(string fullPath)
        {
            var prof = JsonConvert.DeserializeObject<EncryptedProfile>(File.ReadAllText(fullPath));
            return prof;
        }

        public static Profile TryDecryptProfile(string senha, byte[] profile)
        {
            var decryptedBaseAES = DecryptStringFromBytes_Aes(profile, GetPasswordStringIntoByte(senha), aesIVBase);

            var aes = JsonConvert.DeserializeObject<EncryptedJsonAES>(decryptedBaseAES);

            var jsonprofile = DecryptStringFromBytes_Aes(aes.Montain, aes.bytekyte, aes.secbyte);

            return JsonConvert.DeserializeObject<Profile>(jsonprofile);
        }

        private static byte[] EncryptStringToBytes_Aes(string plainText, byte[] Key, byte[] IV)
        {
            if (plainText == null || plainText.Length <= 0)
                throw new ArgumentNullException("plainText");
            if (Key == null || Key.Length <= 0)
                throw new ArgumentNullException("Key");
            if (IV == null || IV.Length <= 0)
                throw new ArgumentNullException("IV");
            byte[] encrypted;

            using (Aes aesAlg = Aes.Create())
            {
                aesAlg.Key = Key;
                aesAlg.IV = IV;

                ICryptoTransform encryptor = aesAlg.CreateEncryptor(aesAlg.Key, aesAlg.IV);

                using (MemoryStream msEncrypt = new MemoryStream())
                {
                    using (CryptoStream csEncrypt = new CryptoStream(msEncrypt, encryptor, CryptoStreamMode.Write))
                    {
                        using (StreamWriter swEncrypt = new StreamWriter(csEncrypt))
                        {
                            swEncrypt.Write(plainText);
                        }
                        encrypted = msEncrypt.ToArray();
                    }
                }
            }

            return encrypted;
        }

        private static string DecryptStringFromBytes_Aes(byte[] cipherText, byte[] Key, byte[] IV)
        {
            if (cipherText == null || cipherText.Length <= 0)
                throw new ArgumentNullException("cipherText");
            if (Key == null || Key.Length <= 0)
                throw new ArgumentNullException("Key");
            if (IV == null || IV.Length <= 0)
                throw new ArgumentNullException("IV");

            string plaintext = null;

            using (Aes aesAlg = Aes.Create())
            {
                aesAlg.Key = Key;
                aesAlg.IV = IV;

                ICryptoTransform decryptor = aesAlg.CreateDecryptor(aesAlg.Key, aesAlg.IV);

                using (MemoryStream msDecrypt = new MemoryStream(cipherText))
                {
                    using (CryptoStream csDecrypt = new CryptoStream(msDecrypt, decryptor, CryptoStreamMode.Read))
                    {
                        using (StreamReader srDecrypt = new StreamReader(csDecrypt))
                        {
                            plaintext = srDecrypt.ReadToEnd();
                        }
                    }
                }
            }

            return plaintext;
        }

        public static string ConvertImgToBase64(string FullPath)
        {
            Image im = Image.FromFile(FullPath);
            MemoryStream mem = new MemoryStream();
            im.Save(mem, im.RawFormat);
            return Convert.ToBase64String(mem.ToArray());
        }
        public static string ConvertImgToBase64(Image im)
        {
            MemoryStream mem = new MemoryStream();
            im.Save(mem, im.RawFormat);
            return Convert.ToBase64String(mem.ToArray());
        }
        public static Image ConvertBase64ToImage(string imgbase64)
        {
            return Image.FromStream(new MemoryStream(Convert.FromBase64String(imgbase64)));
        }




